import React from 'react';

const StartYourJourney = () => {
  const shapeStyle = {
    position: 'absolute',
    left: '270px',
    top: '27px',
    width: '674px',
    height: '405px',
    backgroundColor: '#FFFFFF',
    borderRadius: '16px',
    opacity: 1,
    boxShadow: '4px 0px 4px rgba(0, 0, 0, 0.5), 0px 4px 4px rgba(0, 0, 0, 0.5)',
    zIndex: 30
  };


  return (
    <div>
      <div style={shapeStyle}></div>
    </div>
  );
};

export default StartYourJourney;
